    const context = useContext(noteContext);
    const { notes, setNotes } = context;
    return (
        <div className="cantainer my-3">
            <h1>Your Note</h1>
            {notes.map((note) => {
                return  <Noteitem/>
                
            })}

        </div>
    )
}

export default Note
